export const NetworkIcon = (props) => {
  const { shape, className, spin } = props;
  const newClassName = spin ? `${className} brave-spin` : className;
  return shape === 'circle' ? (
    <Icon component={networkCircle} {...props} className={newClassName} />
  ) : (
    <Icon component={networkSvg} {...props} className={newClassName} />
  );
};

