export const NetIcon = (props) => {
  const { className, spin, type } = props;
  const newClassName = spin ? `${className} brave-spin` : className;
  switch (type) {
    case 'mainnet':
      return (
        <Icon component={netMainSvg} {...props} className={newClassName} />
      );
    case 'ropsten':
      return (
        <Icon component={ropstenSvg} {...props} className={newClassName} />
      );
    case 'kovan':
      return <Icon component={kovanSvg} {...props} className={newClassName} />;
    case 'rinkeby':
      return (
        <Icon component={rinkebySvg} {...props} className={newClassName} />
      );
    case 'goerli':
      return <Icon component={goerliSvg} {...props} className={newClassName} />;
    default:
      return (
        <Icon component={netMainSvg} {...props} className={newClassName} />
      );
  }
};

